import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Home from "./components/Home";
import "./styles.css";

function App() {
  return (
    <Router>
      <header>
        <h1>To Do List</h1>
        <a href="#">Login</a>
      </header>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
